@briarbauman and @jaredmeesracing go P2 and P3 at the high-flying @americanflattrack #PeoriaTT.

Mees secured a critical podium finish in the final laps, as he now sits 25 points behind Bauman, whose three-peat championship hopes now depend on a string of four consecutive miles come. 

